import React from 'react';
import axios from 'axios';

const baseUrl = 'http://localhost:5000/main'

class Index extends React.Component {
    constructor(props) {
        super(props)

        axios.get(baseUrl).then(res => res.js)
    }

    render() {
        return <div></div>
    }
}

export default Index
